INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Delivery', '', 'Our terms and conditions of delivery', 'conditions, delivery, delay, shipment, pack', '<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>', 'delivery'),
(1, 2, 1, 'Envo', '', 'Nuestros trminos y condiciones de envo', 'condiciones, entrega, plazo, envo, paquete', '<h2>Envos y devoluciones</h2><h3>Envo del paquete</h3><p>Como norma general, los paquetes se envan dentro de las 48 horas siguientes a la recepcin del pago, travs de UPS con nmero de seguimiento y entrega sin firma. Si prefieres el envo certificado mediante UPS Extra, se aplicar un cargo adicional. Ponte en contacto con nosotros antes de solicitar esta opcin. Sea cual sea la forma de envo que elijas, te proporcionaremos un enlace para que puedas seguir tu pedido en lnea.</p><p>Los gastos de envo incluyen los gastos de manipulacin y empaquetado, as como los gastos postales. Los gastos de manipulacin tienen un precio fijo, mientras que los gastos de transporte pueden variar segn el peso total del paquete. Te aconsejamos que agrupes todos tus artculos en un mismo pedido. No podemos combinar dos pedidos diferentes, y los gastos de envo se aplicarn para cada uno de manera individual. No nos hacemos responsables de los daos que pueda sufrir tu paquete tras el envo, pero hacemos todo lo posible para proteger todos los artculos frgiles.<br /><br />Las cajas son grandes y tus artculos estarn bien protegidos.</p>', 'entrega'),
(2, 1, 1, 'Legal Notice', '', 'Legal notice', 'notice, legal, credits', '<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>', 'legal-notice'),
(2, 2, 1, 'Aviso legal', '', 'Aviso legal', 'aviso, legal, crditos', '<h2>Legal</h2><h3>Crditos</h3><p>Concepto y produccin:</p><p>Esta tienda online fue creada utilizando el <a href=\"http://www.prestashop.com\">Software Prestashop Shopping Cart</a>. No olvides echarle un vistazo al <a href=\"http://www.prestashop.com/blog/en/\">blog de comercio electrnico</a> de PrestaShop para estar al da y leer todos los consejos sobre la venta online y sobre cmo gestionar tu web de comercio electrnico.</p>', 'aviso-legal'),
